import fetch from 'node-fetch';

export default function GetIssues({ page}) {
    const apiUrl = `http://localhost:3000/issues?page=${page}`;

    console.log("hola")
    return fetch(apiUrl)
      .then(res => res.json())
      .then(response => {
        const { data} = response
        if (Array.isArray(data.results)) {
          console.log(data)
          return data.results;
        }
      })
}
